import React, { useState, useEffect } from "react";
import axios from "axios";

function App() {
  const [destination, setDestination] = useState("");
  const [city, setCity] = useState("");
  const [itinerary, setItinerary] = useState(null);
  const [weather, setWeather] = useState(null);
  const [countries, setCountries] = useState([]);
  const [selectedCountry, setSelectedCountry] = useState("");
  const [cities, setCities] = useState([]);

  // üîπ Fetch all countries when the page loads
  useEffect(() => {
    axios.get("http://127.0.0.1:8000/api/countries")
      .then(response => setCountries(response.data.countries))
      .catch(error => console.error("Error fetching countries:", error));
  }, []);

  // üîπ Fetch cities when a country is selected
  const handleCountryChange = (e) => {
    const country = e.target.value;
    setSelectedCountry(country);

    if (country) {
      axios.get(`http://127.0.0.1:8000/api/cities?country=${country}`)
        .then(response => setCities(response.data.cities))
        .catch(error => console.error("Error fetching cities:", error));
    }
  };

  // üîπ Fetch Itinerary
  const fetchItinerary = async () => {
    if (!destination) return alert("Please enter a destination.");
    try {
      const response = await axios.get(`http://127.0.0.1:8000/api/itinerary?destination=${destination}`);
      setItinerary(response.data);
    } catch (error) {
      console.error("Error fetching itinerary:", error);
    }
  };

  // üîπ Fetch Weather
  const fetchWeather = async () => {
    if (!city) return alert("Please enter a city.");
    try {
      const response = await axios.get(`http://127.0.0.1:8000/api/weather?city=${city}`);
      setWeather(response.data);
    } catch (error) {
      console.error("Error fetching weather:", error);
    }
  };

  return (
    <div style={{ textAlign: "center", fontFamily: "Arial, sans-serif", padding: "20px" }}>
      <h1>üåç AI Travel Planner</h1>

      {/* Country Dropdown */}
      <div>
        <label>Select Country:</label>
        <select onChange={handleCountryChange} value={selectedCountry} style={{ padding: "10px", margin: "5px", borderRadius: "5px" }}>
          <option value="">-- Select a country --</option>
          {countries.map((c) => (
            <option key={c.code} value={c.name}>{c.name}</option>
          ))}
        </select>
      </div>

      {/* City Dropdown */}
      {selectedCountry && (
        <div>
          <label>Select City:</label>
          <select onChange={(e) => setCity(e.target.value)} style={{ padding: "10px", margin: "5px", borderRadius: "5px" }}>
            <option value="">-- Select a city --</option>
            {cities.map((c, index) => (
              <option key={index} value={c.name}>{c.name}</option>
            ))}
          </select>
          <button onClick={fetchWeather} style={{ padding: "10px", borderRadius: "5px", background: "green", color: "white" }}>
            Get Weather
          </button>
        </div>
      )}

      {/* Itinerary Input */}
      <div>
        <input
          type="text"
          placeholder="Enter destination (e.g., Paris)"
          value={destination}
          onChange={(e) => setDestination(e.target.value)}
          style={{ padding: "10px", margin: "5px", borderRadius: "5px" }}
        />
        <button onClick={fetchItinerary} style={{ padding: "10px", borderRadius: "5px", background: "blue", color: "white" }}>
          Get Itinerary
        </button>
      </div>

      {/* Display Itinerary */}
      {itinerary && (
        <div style={{ marginTop: "20px", padding: "15px", border: "1px solid black", borderRadius: "10px" }}>
          <h2>üìå Itinerary for {destination}</h2>
          <p>{itinerary.itinerary}</p>
        </div>
      )}

      {/* Display Weather */}
      {weather && (
        <div style={{ marginTop: "20px", padding: "15px", border: "1px solid black", borderRadius: "10px" }}>
          <h2>üå§ Weather in {city}</h2>
          <p>Temperature: {weather.weather.temperature}¬∞C</p>
          <p>Condition: {weather.weather.description}</p>
        </div>
      )}
    </div>
  );
}

export default App;
